import React, { useState } from 'react';
import './App.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUpload, faSearch, faPlay, faStar } from '@fortawesome/free-solid-svg-icons';

function App() {
  const [fileName, setFileName] = useState("No file selected");
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    if (file) setFileName(file.name);
  };

  const handleAnalyze = () => {
    setLoading(true);
    setTimeout(() => {
      const matchData = {
        bestMatch: { title: "Software Developer", percentage: 83.33 },
        scores: {
          "AI/ML Engineer": 28.57,
          "Backend Developer": 71.43,
          "Cloud Engineer": 14.29,
          "Cybersecurity Analyst": 0,
          "Data Analyst": 42.86,
          "Data Scientist": 28.57,
          "Fronted Developer": 71.43,
          "Full Stack Developer": 57.14,
          "Mobile App Developer": 14.29,
          "Software Developer": 83.33,
          "UI/UX Designer": 0,
        }
      };
      setResult(matchData);
      setLoading(false);
    }, 1500);
  };

  return (
    <div className="container">
      <header className="header">
        <FontAwesomeIcon icon={faSearch} className="icon" />
        Smart Resume Analyzer
      </header>

      <div className="card upload-card">
        <label className="custom-file-upload">
          <input type="file" onChange={handleFileChange} />
          <FontAwesomeIcon icon={faUpload} className="icon" />
          <span>Choose File:</span>
          <em>{fileName}</em>
        </label>
      </div>

      <button className="analyze-button" onClick={handleAnalyze} disabled={loading}>
        <FontAwesomeIcon icon={faPlay} />
        {loading ? 'Analyzing...' : 'Analyze Resume'}
      </button>

      {loading && (
        <div className="loader"></div>
      )}

      {result && !loading && (
        <>
          <div className="card best-match-card">
            <FontAwesomeIcon icon={faStar} className="icon" />
            <span className="best-label">Best Match:</span>
            <span className="best-title">{result.bestMatch.title}</span>
            <span className="best-percent">{result.bestMatch.percentage}%</span>
          </div>

          <div className="card match-card">
            <h3>Match Percentages:</h3>
            <ul>
              {Object.entries(result.scores).map(([role, value]) => (
                <li key={role}>
                  <span className="role-icon">{getRoleEmoji(role)}</span>
                  <span className="role-title">{role}</span>
                  <div className="bar-wrapper">
                    <div
                      className="bar-fill"
                      style={{ width: `${value}%`, backgroundColor: getBarColor(value) }}
                    ></div>
                  </div>
                  <span className="percent">{value}%</span>
                </li>
              ))}
            </ul>
          </div>
        </>
      )}
    </div>
  );
}

function getRoleEmoji(role) {
  const map = {
    "AI/ML Engineer": "ðŸ§ ",
    "Backend Developer": "ðŸ–¥ï¸",
    "Cloud Engineer": "â˜ï¸",
    "Cybersecurity Analyst": "ðŸ›¡ï¸",
    "Data Analyst": "ðŸ“Š",
    "Data Scientist": "ðŸ”¬",
    "Fronted Developer": "ðŸŽ¨",
    "Full Stack Developer": "ðŸ§°",
    "Mobile App Developer": "ðŸ“±",
    "Software Developer": "ðŸ’»",
    "UI/UX Designer": "ðŸŽ¯",
  };
  return map[role] || "ðŸ”§";
}

function getBarColor(val) {
  if (val === 0) return '#ccc';
  if (val >= 80) return '#38b000';
  if (val >= 60) return '#00b4d8';
  if (val >= 30) return '#fcbf49';
  return '#ef476f';
}

export default App;
